1. 广州市市辖区城镇户籍人口;
2. 申请购买限价房时,在广州市市辖区范围内没有现时登记住宅产权;属已婚人员的,申请购买限价房,夫妻双方各自在广州市市辖区范围内没有现时登记住宅产权;
3. 男性年满25周岁,女性年满23周岁;
4. 个人申购的,本人税前年收入在10万元以下;以夫妻联名方式申购的,家庭税前年收入在20万元以下。个人和家庭税前年收入情况由申请人在购买限价房时自行如实申报。
5. 根据《管理办法》第二十三条和《***广州市委、广州市人民政府印发〈关于鼓励海外高层次人才来穗创业和工作的办法》的通知〉》(穗字〔2008〕18号)第十条规定,符合条件的海外高层次人才,不受上述①至④条的限制,可以优先购买限价房。

招聘条件
1.具有中华人民共和国国籍，享有公民的政治权利;
2.热爱教育事业，遵纪守法，品行端正，有良好的职业道德;无违法违纪记录;
3.身体健康，胜任应聘职位的工作;
4、符合国家计划生育政策;
5.具备所聘岗位规定的本科及以上学历条件;
6.取得与所聘岗位相应的教师资格证;
7.同时具备岗位所需要的其他具体资格条件以及其他具体要求(详见职位表)。

